pragma solidity ^0.4.18;

import "./Ownable.sol";

contract Vehicule is Ownable {

    address REGISTRY;

    string public brand;
    string public model;
    string public vType;
    string public engine;
    string public extras;
    bytes32 public vin;
    uint16 public year;

    uint public lastUpdate;

    enum EventType {
        Creation, Transfer,
        ReceivedAtDealer, ReceivedAtServiceShop,
        Maintenance, AutoSensor, ManualSensor,
        Sell, Buy
    }

    event OnActionEvent (
        EventType indexed _event,
        address _ref,
        string _description,
        string _data,
        uint _timestamp,
        uint indexed _blockNumber
    );

    function Vehicule(address _ref, address _registry, string _brand, string _model, string _type, string _engine, string _extras, bytes32 _vin, uint16 _year) public {
        REGISTRY = _registry;
        lastUpdate = block.number;
        brand = _brand;
        model = _model;
        vType = _type;
        engine = _engine;
        extras = _extras;
        vin = _vin;
        year = _year;
        owner = _ref;
        OnActionEvent(EventType.Creation, _ref, "Vehicule Creation","", now, block.number);
    }

    function addAction(EventType _event, address _ref, string _description, string _data) public {
        require(msg.sender != _ref);
        lastUpdate = block.number;
        OnActionEvent(_event, _ref, _description, _data, now, block.number);
    }

}
